import React, { useState, useEffect } from 'react';
import LoadingIndicator from './components/design-2020/loading-indicators/loading-indicator';

const App = () => {
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    setTimeout(() => {
      setIsLoading(false);
    }, 3000);
  }, []);

  return (
    <body className="cv-wrapper">
      {
        isLoading ?
          <LoadingIndicator />
          : <h1>dasdas</h1>
        }
    </body>
  );
};

export default App;
